import React from 'react'
import {order} from '../../utility/constant'

const Order = () => {
       const myOrder=()=>{
           order.map(ord=>{
             let orderStatus;
             if (ord.status==="paid") {
                 orderStatus = <p>paid</p>
             }
             if (ord.status ==="order:cancelled") {
                 orderStatus = <p>cancelled order</p>
             }
             if (ord.status === "order:expired") {
                 orderStatus = <p>order expired</p>
             }

             return(
               <div className="">
                   <p>{ord.orderId}</p>
               </div>
             )
           })
       }



    return (
        <div className="border-dotted border border-gray-700 px-2">
            <h1 className="font-bold text-gray-900 text-2xl my-4">Orders</h1>
        </div>
    )
}

export default Order
